import React from 'react';
import { Outlet, Link } from 'react-router-dom';

export default function Visitor() {
  return (
    <header className="bg-danger text-blue-800 py-2">
      <div className="container-fluid">
        {/* Top Bar */}
        <div className="d-flex justify-content-between align-items-center">
          <div className="d-flex align-items-center">
            <i className="bi bi-geo-alt-fill me-2"></i>
            <span>Enter your location pin-code</span>
          </div>
          <div className="d-flex align-items-center">
            <i className="bi bi-envelope me-2"></i>
            <span>pureit.hul@unilever.com</span>
            <span className="mx-3">|</span>
            <i className="bi bi-whatsapp me-2"></i>
            <span>+919739101344</span>
            <span className="mx-3">|</span>
            <i className="bi bi-telephone-fill me-2"></i>
            <span>Customer Support: 1800-570-1000</span>
          </div>
        </div>
      </div>

      <div className="container-fluid rounded-2 bg-dark">
        {/* Main Navigation */}
        <div className="container">
          <nav className="navbar navbar-expand-lg mt-2">
            <div className="container-fluid">
              <Link className="navbar-brand" to="/">
                <img
                  src="/logo.png" // Replace with your logo path
                  alt="PureIt Logo"
                  height="40"
                />
              </Link>
              <button
                className="navbar-toggler"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#navbarNav"
                aria-controls="navbarNav"
                aria-expanded="false"
                aria-label="Toggle navigation"
              >
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav mx-auto">
                  <li className="nav-item">
                    <Link className="nav-link" to="/water-purifier">
                      WATER PURIFIER
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/order-germ-kill-kit">
                      ORDER GERM KILL KIT
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/water-and-health">
                      WATER & HEALTH
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/about-pureit">
                      ABOUT PUREIT
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/book-demo">
                      BOOK DEMO
                    </Link>
                  </li>
                </ul>
                <form className="d-flex">
                  <input
                    className="form-control me-2"
                    type="search"
                    placeholder="Type to search"
                    aria-label="Search"
                  />
                  <button className="btn btn-outline-secondary" type="submit">
                    <i className="bi bi-search"></i>
                  </button>
                </form>
                <div className="d-flex align-items-center ms-3">
                  <Link to="/sign-in" className="text-dark me-3">
                    <i className="bi bi-person"></i> Sign In
                  </Link>
                  <Link to="/cart" className="text-dark">
                    <i className="bi bi-cart"></i>
                  </Link>
                </div>
              </div>
            </div>
          </nav>
        </div>
      </div>
    </header>
  );
}
